Jahan Pyar Mile is directed by Lekh Tandon. The film stars Shashi Kapoor, Hema Malini, Nadira and Helen. The films music is by Shankar Jaikishan.
This is Hema Malini's second film and she has still done a commendable job. Shashi kapoor has however stolen the show with his remarkable act.

Superhit Songs :
Chale ja Chale ja Chale ja, Jahan Pyar Mile by Suman kalyanpur
Chale ja Chale ja Chale ja, Jahan Pyar Mile by Mohd Rafi
Nas Nas mein agan, Tute hain Badan by Lata mangeshkar
Baat Zara Aapas Ki by Sharda

Awards :
1970 Filmfare Best Female Playback Award Sharda for the song &quot;Baat Zara Aapas Ki&quot; filmed on Helen doing a Cabaret dance.

